import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
    Container,
    Grid,
    Card,
    CardContent,
    Typography,
    TextField,
    Select,
    MenuItem,
    FormControl,
    InputLabel,
    Box,
    Chip,
    Avatar,
    Button,
    Pagination,
    CircularProgress,
    Alert
} from '@mui/material';
import axios from 'axios';

function Feed() {
    const navigate = useNavigate();
    const [developers, setDevelopers] = useState([]);
    const [trending, setTrending] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');
    const [page, setPage] = useState(0);
    const [totalPages, setTotalPages] = useState(0);
    const [search, setSearch] = useState('');
    const [experienceLevel, setExperienceLevel] = useState('');

    const fetchDevelopers = async () => {
        setLoading(true);
        setError('');
        try {
            const params = new URLSearchParams();
            params.append('page', page);
            params.append('size', 9);
            if (search) params.append('search', search);
            if (experienceLevel) params.append('experienceLevel', experienceLevel);

            const response = await axios.get(`/api/feed/developers?${params.toString()}`);
            setDevelopers(response.data.content);
            setTotalPages(response.data.totalPages);
        } catch (err) {
            setError('Erro ao carregar desenvolvedores: ' + err.message);
        } finally {
            setLoading(false);
        }
    };

    const fetchTrending = async () => {
        try {
            const response = await axios.get('/api/feed/trending');
            setTrending(response.data);
        } catch (err) {
            console.error('Erro ao carregar trending:', err);
        }
    };

    useEffect(() => {
        fetchDevelopers();
        fetchTrending();
    }, [page, search, experienceLevel]);

    const handlePageChange = (event, value) => {
        setPage(value - 1);
    };

    const handleSearch = (event) => {
        setSearch(event.target.value);
        setPage(0);
    };

    const handleExperienceLevelChange = (event) => {
        setExperienceLevel(event.target.value);
        setPage(0);
    };

    const DeveloperCard = ({ developer }) => (
        <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
            <CardContent>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    <Avatar 
                        src={`https://github.com/${developer.github}.png`}
                        sx={{ width: 56, height: 56, mr: 2 }}
                    />
                    <Box>
                        <Typography variant="h6" component="div">
                            {developer.name}
                        </Typography>
                        <Typography color="text.secondary">
                            {developer.experienceLevel}
                        </Typography>
                    </Box>
                </Box>
                
                <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
                    {developer.bio || 'Sem biografia'}
                </Typography>

                {developer.github && (
                    <Button 
                        variant="outlined" 
                        size="small"
                        href={`https://github.com/${developer.github}`}
                        target="_blank"
                        sx={{ mr: 1 }}
                    >
                        GitHub
                    </Button>
                )}
                
                <Button 
                    variant="contained" 
                    size="small"
                    onClick={() => navigate(`/profile/${developer.id}`)}
                >
                    Ver Perfil
                </Button>
            </CardContent>
        </Card>
    );

    return (
        <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
            <Grid container spacing={3}>
                {/* Filtros */}
                <Grid item xs={12}>
                    <Box sx={{ display: 'flex', gap: 2, mb: 3 }}>
                        <TextField
                            label="Buscar desenvolvedor"
                            variant="outlined"
                            value={search}
                            onChange={handleSearch}
                            sx={{ flexGrow: 1 }}
                        />
                        <FormControl sx={{ minWidth: 200 }}>
                            <InputLabel>Nível de Experiência</InputLabel>
                            <Select
                                value={experienceLevel}
                                label="Nível de Experiência"
                                onChange={handleExperienceLevelChange}
                            >
                                <MenuItem value="">Todos</MenuItem>
                                <MenuItem value="JUNIOR">Júnior</MenuItem>
                                <MenuItem value="PLENO">Pleno</MenuItem>
                                <MenuItem value="SENIOR">Sênior</MenuItem>
                            </Select>
                        </FormControl>
                    </Box>
                </Grid>

                {/* Lista de Desenvolvedores */}
                <Grid item xs={12} md={9}>
                    {error && (
                        <Alert severity="error" sx={{ mb: 2 }}>
                            {error}
                        </Alert>
                    )}

                    {loading ? (
                        <Box sx={{ display: 'flex', justifyContent: 'center', p: 3 }}>
                            <CircularProgress />
                        </Box>
                    ) : (
                        <>
                            <Grid container spacing={3}>
                                {developers.map(developer => (
                                    <Grid item xs={12} sm={6} md={4} key={developer.id}>
                                        <DeveloperCard developer={developer} />
                                    </Grid>
                                ))}
                            </Grid>

                            <Box sx={{ display: 'flex', justifyContent: 'center', mt: 3 }}>
                                <Pagination 
                                    count={totalPages} 
                                    page={page + 1} 
                                    onChange={handlePageChange}
                                    color="primary"
                                />
                            </Box>
                        </>
                    )}
                </Grid>

                {/* Trending Developers */}
                <Grid item xs={12} md={3}>
                    <Typography variant="h6" gutterBottom>
                        Trending Developers
                    </Typography>
                    <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
                        {trending.map(developer => (
                            <Card key={developer.id}>
                                <CardContent>
                                    <Box sx={{ display: 'flex', alignItems: 'center' }}>
                                        <Avatar 
                                            src={`https://github.com/${developer.github}.png`}
                                            sx={{ width: 40, height: 40, mr: 1 }}
                                        />
                                        <Box>
                                            <Typography variant="subtitle2">
                                                {developer.name}
                                            </Typography>
                                            <Typography variant="caption" color="text.secondary">
                                                {developer.experienceLevel}
                                            </Typography>
                                        </Box>
                                    </Box>
                                </CardContent>
                            </Card>
                        ))}
                    </Box>
                </Grid>
            </Grid>
        </Container>
    );
}

export default Feed;
